class LoginFormCtrl {
    constructor() {
        'ngInject';

        var i18n = {};
        //TODO ? add texts from constructor

        i18n.loginLabelText = "loginLabelText";
        i18n.passwordLabelText = "passwordLabelText";
        i18n.loginRequiredText = "loginRequiredText";
        i18n.passwordRequiredText = "passwordRequiredText";
        i18n.loginButtonText = "loginButtonText";
        i18n.registerLinkText = "registerLinkText";

        this.i18n = i18n;
        this.dataLoadingImg = "data:image/gif;base64,";

    }


    doLogin() {
        this.dataLoading = true;
        AuthenticationService.login(this.login, this.password, function (response) {
            if (response.success) {
                //AuthenticationService.SetCredentials(vm.username, vm.password); //TODO: Add service for SessionStorage
            } else {
                //FlashService.Error(response.message); //TODO: Add service for messaging: error/success etc
                this.dataLoading = false;
            }
        });
    }

}

export default LoginFormCtrl;
